    obtenerPeriodos() {
        return this.convocatoriaService.getPeriodo()
            .subscribe((res) => {
            console.log(res);
            for (var i = 0; i < res.length; i++) {
                if ((res[i]['id']) = this.idPeriodorecibido) {
                    this.periodos = res[i];
                    console.log(this.periodos);
                    this.periodo = res[i]['periodo'];
                }
            }
        });
    }
